--  CREATING THE TRIGGERS
DELIMITER $$
CREATE TRIGGER update_hotel_count
AFTER INSERT ON Hotel
FOR EACH ROW
BEGIN
    UPDATE HotelChain
    SET numberOfHotels = numberOfHotels + 1
    WHERE hotelChainId = NEW.hotelChainId;
END; $$
DELIMITER ;

DELIMITER $$
CREATE TRIGGER validate_booking_dates
BEFORE INSERT ON Booking
FOR EACH ROW
BEGIN
    IF NEW.endDate <= NEW.startDate THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: End date must be greater than start date.';
    END IF;
END; $$
DELIMITER ;

SET FOREIGN_KEY_CHECKS=@OLD_FOREIGN_KEY_CHECKS;
